	(7760,'http://www.villagevoice.com/events/jimmy-fallon-2575284/','Jimmy Fallon','jimmy-fallon','Jimmy Fallon  isn\'t short on saying thanks. During his \"Thank You Notes\" segment on  Late Night With Jimmy Fallon , he writes thank-yous to various celebrities (like Chris Brown for his \"smash hit\") and objects (such as a gift bag for not being a boring plastic bag) and friends (as he recently said, \"Thank you, friend who texts me a happy birthday or congratulations, that doesn\'t do anything for my rep. Put that shiz on my Facebook wall where it counts!\" Now the late-night host and  Saturday Night Live  alum is putting his thank-you\'s where they countin a book. Fallon reads tonight from  Thank You Notes . We imagine it should be just like watching his show in person. Journalist Katherine Lanpher serves as hostoh, and even better, the Roots will be there, too.',4,'2011-05-24 16:50:48','2011-05-24 16:50:48','http://www.villagevoice.com/events/jimmy-fallon-2575284/','http://vvoice.vo.llnwd.net/e14//6337159.47.jpg','',34,'event_images/dfb0c1f9adc1fa3ad4268cbc8cf0708e9fa874c5_1.jpg',1,6),
