	(7970,'http://www.villagevoice.com/events/luis-camnitzer-2083269/','Luis Camnitzer','luis-camnitzer','Luis Camnitzer is an internationally recognized artist, as well as a critic, educator and art theorist. Allied with conceptual art, Camnitzer has developed an essentially autonomous oeuvre. His work is unmistakably distinguished from that of his colleagues by its acutely observed detail and lyrical qualities, acerbic wit, ironically metaphorical polyvalence, and solid socio-political commitment. This exhibition is part of El Museos FOCOS series highlighting the achievements of mature, under-recognized artists.',4,'2011-05-24 16:51:14','2011-05-24 16:51:14','http://www.villagevoice.com/events/luis-camnitzer-2083269/','','',171,'',1,0),
