	(8853,'http://www.villagevoice.com/events/dum-dum-girls-acoustic-2588107/','Dum Dum Girls (acoustic)','dum-dum-girls-acoustic','It\'s hard to avoid the Best Coast/Dum Dum Girls comparisons: both hail from Southern California and work the \'60s girl-group style du jour. (Dum Dums\' debut full-length album,  I Will Be , was produced by Richard Gottehrer, who wrote \"My Boyfriend\'s Back\" for crying out loud.) But if Best Coast are the equivalent of a teenage Valley Girl whining about not having a boyfriend, the Dum Dum Girls are her sharper, self-actualized older sister who listens to Jesus and Mary Chain in the dark. It\'ll be interesting to see what an acoustic set holds for a band that banks so heavily on obscuring sweet melodies behind thick, melancholy fuzz. With Crocodiles and Woven Bones, both acoustic.',4,'2011-05-24 16:53:08','2011-05-24 16:53:08','http://www.villagevoice.com/events/dum-dum-girls-acoustic-2588107/','http://vvoice.vo.llnwd.net/e14//6365039.47.jpg','',137,'event_images/d6566676c39f6efc2dbb461b9e2b32925f8c8fae.jpg',1,1),
