	(8884,'http://www.villagevoice.com/events/and-147-bright-fieldand-148-music-and-modernism-2393719/','Bright Field: Music and Modernism','bright-field-music-and-modernism','During the decade leading up to the first World War, composers such as Debussy, Schoenberg, Scriabin, and Stravinsky were writing music in active dialogue with the social upheavals, intellectual currents, and political events of their day, embracing the same radical spirit that inspired their colleagues in the visual arts. This gallery program highlights selections of music from 191018 alongside the works in The Great Upheaval. A talk by American composer R. Luke DuBois precedes the concert.',4,'2011-05-24 16:53:12','2011-05-24 16:53:12','http://www.villagevoice.com/events/and-147-bright-fieldand-148-music-and-modernism-2393719/','','',34,'',1,0),
