	(8919,'http://www.villagevoice.com/events/blkmarket-membership-presents-sven-vath-2586110/','Blkmarket Membership Presents Sven Vath','blkmarket-membership-presents-sven-vath','Sven Vath would have seemed to reach the peak of his career in the early \'90s, when the Frankfurt DJ\'s Eye Q and Harthouse labels worked with artists including Hardfloor and Alter Ego to release some of the world\'s best acid- and trance-inflected house and techno. Then Vath stepped away from those labels only to found the equally impressive Cocoon in 2000. His series of mixes there (\"The Sound of the 11th Season\" came out last fall) perennially prove that he still has not only impeccable taste but the rare ability to string records into a mind-bending experience. Residents Taimur & Fahad celebrate their party\'s fifth anniversary.',4,'2011-05-24 16:53:17','2011-05-24 16:53:17','http://www.villagevoice.com/events/blkmarket-membership-presents-sven-vath-2586110/','http://vvoice.vo.llnwd.net/e14//6365405.47.jpg','',137,'event_images/28ceb3f1c07445a84b20af2b3e174c8dfb495d52.jpg',1,5),
