	(7707,'http://www.villagevoice.com/events/granta-magazines-the-f-word-launch-party-in-nyc-2527685/','Granta Magazine\'s The F Word Launch Party in NYC','granta-magazines-the-f-word-launch-party-in-nyc','When the 2010 VIDA study showed that male writers were published and reviewed far more often in established newspapers, magazines, and literary journals in America and the U.K. than female writers, it was a wake-up call to many in the industry. Leading the charge to correct this imbalance, British literary magazine  Granta  has created the new feminist-themed issue The F Word. Proving that there is absolutely no shortage of female greats, the all-female issue includes a must-read essay by Francine Prose on the feminist group she belonged to in the 70s; a piece by Rachel Cusk on her divorce and the breakdown of her family; and fiction by Louise Erdrich, Edwidge Danticat, and Lydia Davis, among others. Tonight, at  Grantas F Word Launch Party , hear editor John Freeman and contributors Julie Otsuka and Taiye Selasi discuss the new issuethen go out and buy a book by a lady!',4,'2011-05-24 16:50:41','2011-05-24 16:50:41','http://www.villagevoice.com/events/granta-magazines-the-f-word-launch-party-in-nyc-2527685/','http://vvoice.vo.llnwd.net/e14//6341949.47.jpg','',34,'event_images/e266366efacba71194a56c2cde787c58d6421e42.jpg',1,0),
