	(7829,'http://www.villagevoice.com/events/journey-to-the-stars-1804212/','Journey to the Stars','journey-to-the-stars','Journey to the Stars, an all-new Hayden Planetarium space show narrated by Academy Awardwinning actress Whoopi Goldberg, launches visitors through time and space to experience the life and death of the stars in our night sky. Audiences travel 13 billion years into the past, when the first stars were born, and witness brilliant supernova explosions that sent new kinds of matter coursing through the universe, into the atoms of our own bodies and the air we breathe. They visit the heart of our fiery Sun, and glimpse its eventual demise as it transforms into a massive red giant some five billion years in the future. Visitors tour stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars.',4,'2011-05-24 16:50:56','2011-05-24 16:50:56','http://www.villagevoice.com/events/journey-to-the-stars-1804212/','','',34,'',1,62),
	(8039,'http://www.villagevoice.com/events/shock-treatment-2584383/','Shock Treatment','shock-treatment','Dir. Jim Sharman (1981).\nReleased several years into the  Rocky Horror  cult, this would be sequel pleased no one at the time but its actually a credible rock musical that cant stop thinking about its own role in the 20th centurys most elaborate midnight movie ritual. ',4,'2011-05-24 16:51:23','2011-05-24 16:51:23','http://www.villagevoice.com/events/shock-treatment-2584383/','http://vvoice.vo.llnwd.net/e14//6354566.47.jpg','',29,'event_images/d4a1469eddbd4b8b81b6fcc43dc9b93c9abc01c9.jpg',1,0),
