	(8977,'http://www.villagevoice.com/events/the-vinyl-frontier-2586159/','The Vinyl Frontier','the-vinyl-frontier','Can\'t afford a fancy painting for your wall? Why not try collecting designer toys?, ask the toy-making artists in the new documentary  The Vinyl Frontier . First-time director Daniel Zana\'s film goes inside toy shows and artists\' studios to uncover why so many adults are shelling out hundreds upon hundreds of dollars for limited-edition Dunnys, Uglydolls, Devilrobots, and the like. Underground-artists-turned-toy-makers interviewed in the film include Ron English, Sket One, Tristan Eaton, Dalek, Tara McPherson, Bwana Spoons, and Tim Biskup. After the screening, Zana will be on hand for a Q&A with a few of the artists.',4,'2011-05-24 16:53:25','2011-05-24 16:53:25','http://www.villagevoice.com/events/the-vinyl-frontier-2586159/','http://vvoice.vo.llnwd.net/e14//6358454.47.jpg','',29,'event_images/e9ac6ec0c476892e92b6d931d3e1b224988615de.jpg',1,1),
