	(8083,'http://www.villagevoice.com/events/shock-treatment-2586163/','Shock Treatment','shock-treatment','Two decades before reality TV became pretty much the only thing on the air, Jim Sharman and Richard O\'Brien, the team behind  The Rocky Horror Picture Show  (1975), attempted to follow up their cult classic with a prescient comment on national voyeurism.  Shock Treatment  (1981) stars the unfamiliar Cliff De Young and Jessica Harper as the familiar Brad and Janetnow a married couple living in a town that doubles as a television studio, which broadcasts its residents 24 hours a day. Despite appearances by much of  Rocky \'s beloved cast, who by \'81 were cult heroes, the musical was a bigger flop than its predecessor. Till now?',4,'2011-05-24 16:51:28','2011-05-24 16:51:28','http://www.villagevoice.com/events/shock-treatment-2586163/','http://vvoice.vo.llnwd.net/e14//6358494.47.jpg','',29,'event_images/37f0daf7c6d06db1370eb8c7ee223ac05d547815.jpg',1,0),
