	(8109,'http://www.villagevoice.com/events/six-a-side-field-hockey-tournament-2586181/','Six-A-Side Field Hockey Tournament','six-a-side-field-hockey-tournament','Field hockey may be the world\'s third most popular participatory sportranking only after soccer and cricket (its origins are in the early game of hurling, dating all the way back to ancient Egypt around 1200 B.C.). The game is played today in New York largely under the auspices of Big Apple Hockey, a not-for-profit group that promotes field hockey to a high caliber of competition and sportsmanship. Over Memorial Day weekend, BAHF sponsors their annual  Six-A-Side Field Hockey Tournament  at the fabulous Aviator Mega-Sports Complex in Brooklyn at the site of the old Floyd Bennett Field, New York\'s first municipal airport. The tournament honors the lives of players, coaches, mentors, fans, and loved ones who have contributed to the game of field hockey. Emphasis is placed on encouraging young players.',4,'2011-05-24 16:51:31','2011-05-24 16:51:31','http://www.villagevoice.com/events/six-a-side-field-hockey-tournament-2586181/','http://vvoice.vo.llnwd.net/e14//6358518.47.jpg','',2,'event_images/1c29fd84ced2f9d189a35d22bc51cab780fe2711.jpg',1,0),
