	(8131,'http://www.villagevoice.com/events/the-cars-2584177/','The Cars','the-cars','The Cars\' brand-spanking-new album  Move Like This  is naturally supposed to be a comeback album, since it\'s their first release in nearly 25 years. But it\'s probably not going to revive their glory days--their late \'70s and early \'80s releases just set the bar too high for that, and by this point, frontman Ric Ocasek sounds pretty worn out as a singer and tapped dry as a songwriter. But what\'s still striking is how little the band\'s aesthetic formula has changed, despite all the improvements in record production since then. It\'s not so much that they were ahead of their time--more that they just swung for the fences during their era. Which, sadly, is still long gone.',4,'2011-05-24 16:51:34','2011-05-24 16:51:34','http://www.villagevoice.com/events/the-cars-2584177/','http://vvoice.vo.llnwd.net/e14//6364738.47.jpg','',137,'event_images/6b729eeb178b91b0af713a942117779d5539630a.jpg',1,0),
