	(8346,'http://www.villagevoice.com/events/petes-mini-zine-fest-2586178/','Pete\'s Mini Zine Fest','petes-mini-zine-fest','Proving that there\'s still nothing quite as satisfying as staying all hours at Kinko\'s to make a publication you can hold in your hands, the second annual  Pete\'s Mini Zine Fest  shows off the DIY creations of more than 20 zinemakers for your print-reading enjoyment. Zinesters Andria Alefhi ( We\'ll Never Have Paris ) and Marguerite Dabaie ( The Hookah Girl and Other True Stories ) host the festival, which includes Katie Haegele ( The La-La Theory ), Jenna Freedman (of the Barnard Zine Library, a treasure trove of feminist punk-rock zines), and  FOUND  magazine\'s Davy Rothbart.',4,'2011-05-24 16:52:01','2011-05-24 16:52:01','http://www.villagevoice.com/events/petes-mini-zine-fest-2586178/','http://vvoice.vo.llnwd.net/e14//6358508.47.jpg','',34,'event_images/4af693eb5420d3d2005f60cd50b8feb639404cf3.jpg',1,4),
