	(8437,'http://www.villagevoice.com/events/the-motherfker-with-the-hat-2430552/','The Motherf**ker With the Hat','the-motherfker-with-the-hat','Last time we saw Chris Rock, he was right here in our newsroom playing a  Village Voice  reporter in Julie Delpy\'s upcoming film  2 Days in New York . Now the busy actor-comedian is making his Broadway debut in Stephen Adly Guirgis\'s  The Motherf**cker With the Hat.   Directed by Tony winner Anna D. Shapiro, the play concerns Jackie, an ex-con on parole who\'s desperately trying to stay clean and sober despite the fact that his longtime soul mate is not. Nevertheless, he\'s determined to make it workuntil, that is, a hat threatens to come between them. Bobby Cannavale, Elizabeth Rodriguez, Annabella Sciorra, and Yul Vázquez also star.',4,'2011-05-24 16:52:13','2011-05-24 16:52:13','http://www.villagevoice.com/events/the-motherfker-with-the-hat-2430552/','http://vvoice.vo.llnwd.net/e14//6100929.47.jpg','',124,'event_images/9a68d96022a97b72c232d8fea2c5bda113df19d6_1.jpg',1,0),
