	(8640,'http://www.villagevoice.com/events/dylan-fest-2011-2586157/','Dylan Fest 2011','dylan-fest-2011','Two days after Bob Dylan turns 70 years (forever) young, he will be feted by some ardent local fans at  Dylan Fest 2011 , this year\'s fond incarnation of the annual cover-palooza. Norah Jones, Jesse Malin, Evan Dando, Adam Green, Nikolai Fraiture (of the Strokes), and many more artists will be on hand to share fingerpicked revisitings of the iconoclast\'s greatest hits: We have a feeling \"Maggie\'s Farm\" and \"Tangled Up in Blue\" will get some play, but will anyone dare croon the protest beacon \"Only a Pawn in Their Game\" tonight? Hopefully not, because that could skew a bit untoward. Bobby will come back from Mustique, et al., to pain on them.',4,'2011-05-24 16:52:40','2011-05-24 16:52:40','http://www.villagevoice.com/events/dylan-fest-2011-2586157/','http://vvoice.vo.llnwd.net/e14//6358447.47.jpg','',137,'event_images/cf82dc82c4a5718e4816058d795cd933a178d16b.jpg',1,33),
