	(8814,'http://www.villagevoice.com/events/times-new-viking-2586161/','Times New Viking','times-new-viking','Times New Viking  lurched from the Columbus, Ohio, underground in 2005 with a blown-out, speaker-grating, ear-poking, beyond-the-red sound that launched a thousand trend piecesyou may remember buzzwords like \"lo-fi,\" \"no-fi,\" \"shitgaze,\" or the lesser-used \"shit-fi\" until \"chillwave\" distracted us. Their Matador coming-out party for their 2008 album,  Rip It Off , was 31 minutes of treble-trouble fucksquall like Guided by Voices recording on My First Sonyprobably the harshest thing they\'ve co-signed since the days of the Bunnybrains. But for this year\'s  album,  Dancer Equired , the band (now on Merge) emerged like indie-rock butterflies who had been incubating way too long in a tape-hiss cocoon. They had these chiming, clear-headed hooks all along, and now aren\'t shy about showing them offonce the crust is peeled away, and someone actually mics their drums, TNV are actually making cuddly Vaselines records for modern softies. Aww! With The Babies and Phantom Family Halo.',4,'2011-05-24 16:53:03','2011-05-24 16:53:03','http://www.villagevoice.com/events/times-new-viking-2586161/','http://vvoice.vo.llnwd.net/e14//6358465.47.jpg','',137,'event_images/30e5356d20f91b893634c3f9da3246460903d688.jpg',1,3),
